import React, { useState, useEffect } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import { usePerformanceAPI } from './hooks/usePerformanceAPI';
import { 
  Activity, Brain, Zap, BarChart3, History, Settings, 
  Play, Square, RotateCcw, Target, Users, Clock, TrendingUp,
  AlertTriangle, CheckCircle, X, Plus, Download, Upload
} from 'lucide-react';

function App() {
  const [activeSection, setActiveSection] = useState('dashboard');
  const [currentTest, setCurrentTest] = useState(null);
  const [testResults, setTestResults] = useState(null);
  const [analysis, setAnalysis] = useState(null);
  const [testHistory, setTestHistory] = useState([]);
  const [showImageInput, setShowImageInput] = useState(false);
  const [imageUrl, setImageUrl] = useState('');
  const [testConfig, setTestConfig] = useState({
    type: 'Load Test',
    url: '',
    users: 100,
    duration: 600,
    rampUp: 10,
    thinkTime: 1000
  });

  const { 
    connectionStatus, 
    loading, 
    error, 
    backendUrl,
    startTest,
    getTestStatus,
    analyzeResults,
    analyzeResultsWithImage,
    listTests,
    getTestHistory,
    getAgentMemory,
    getAgentStatus,
    checkConnection
  } = usePerformanceAPI();

  // Load test history on component mount
  useEffect(() => {
    loadTestHistory();
  }, []);

  const loadTestHistory = async () => {
    try {
      const history = await getTestHistory();
      if (history.success) {
        setTestHistory(history.history || []);
      }
    } catch (error) {
      console.error('Failed to load test history:', error);
    }
  };

  const handleStartTest = async () => {
    if (!testConfig.url.trim()) {
      alert('Please enter a target URL');
      return;
    }
    
    try {
      const result = await startTest(testConfig);
      setCurrentTest(result);
      setActiveSection('monitoring');
    } catch (error) {
      console.error('Failed to start test:', error);
    }
  };

  const handleStopTest = async () => {
    if (currentTest?.testId) {
      try {
        // Stop test logic would go here
        setCurrentTest(null);
        setActiveSection('dashboard');
      } catch (error) {
        console.error('Failed to stop test:', error);
      }
    }
  };

  const handleAnalyze = async (data) => {
    try {
      let analysisResult;
      if (imageUrl && showImageInput) {
        analysisResult = await analyzeResultsWithImage(data, imageUrl);
      } else {
        analysisResult = await analyzeResults(data);
      }
      setAnalysis(analysisResult);
      setActiveSection('analysis');
    } catch (error) {
      console.error('Failed to analyze results:', error);
    }
  };

  const handleTestComplete = (results) => {
    setTestResults(results);
    setCurrentTest(null);
    setActiveSection('results');
  };

  const getConnectionStatusColor = () => {
    switch (connectionStatus) {
      case 'connected': return 'text-green-500';
      case 'disconnected': return 'text-red-500';
      case 'checking': return 'text-yellow-500';
      default: return 'text-gray-500';
    }
  };

  const getConnectionStatusText = () => {
    switch (connectionStatus) {
      case 'connected': return 'Connected';
      case 'disconnected': return 'Disconnected';
      case 'checking': return 'Checking...';
      default: return 'Unknown';
    }
  };

  const formatDuration = (seconds) => {
    const minutes = Math.floor(seconds / 60);
    const remainingSeconds = seconds % 60;
    return `${minutes}m ${remainingSeconds}s`;
  };

  const sections = [
    { id: 'dashboard', label: 'Dashboard', icon: Activity },
    { id: 'config', label: 'Test Config', icon: Settings },
    { id: 'monitoring', label: 'Monitoring', icon: BarChart3 },
    { id: 'results', label: 'Results', icon: Zap },
    { id: 'analysis', label: 'AI Analysis', icon: Brain },
    { id: 'history', label: 'History', icon: History }
  ];

  return (
    <div className="min-h-screen bg-gradient-to-br from-slate-900 via-purple-900 to-slate-900">
      {/* Header */}
      <header className="bg-white/10 backdrop-blur-md border-b border-white/20">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="flex justify-between items-center h-16">
            <div className="flex items-center space-x-4">
              <div className="flex items-center space-x-2">
                <Brain className="h-8 w-8 text-purple-400" />
                <h1 className="text-xl font-bold text-white">Ludo Performance Suite</h1>
              </div>
              <div className="flex items-center space-x-2">
                <div className={`w-2 h-2 rounded-full ${connectionStatus === 'connected' ? 'bg-green-400' : connectionStatus === 'checking' ? 'bg-yellow-400' : 'bg-red-400'}`}></div>
                <span className={`text-sm ${getConnectionStatusColor()}`}>
                  {getConnectionStatusText()}
                </span>
              </div>
            </div>
            
            <div className="flex items-center space-x-4">
              <div className="text-xs text-gray-400">
                Backend: {backendUrl}
              </div>
              {error && (
                <div className="text-xs text-red-400 bg-red-900/20 px-2 py-1 rounded">
                  {error}
                </div>
              )}
            </div>
          </div>
        </div>
      </header>

      {/* Navigation */}
      <nav className="bg-white/5 backdrop-blur-sm border-b border-white/10">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="flex space-x-8">
            {sections.map((section) => (
              <button
                key={section.id}
                onClick={() => setActiveSection(section.id)}
                className={`flex items-center space-x-2 py-4 px-1 border-b-2 font-medium text-sm transition-colors ${
                  activeSection === section.id
                    ? 'border-purple-400 text-purple-400'
                    : 'border-transparent text-gray-300 hover:text-white hover:border-gray-300'
                }`}
              >
                <section.icon className="h-5 w-5" />
                <span>{section.label}</span>
              </button>
            ))}
          </div>
        </div>
      </nav>

      {/* Main Content */}
      <main className="max-w-7xl mx-auto py-6 sm:px-6 lg:px-8">
        <AnimatePresence mode="wait">
          <motion.div
            key={activeSection}
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            exit={{ opacity: 0, y: -20 }}
            transition={{ duration: 0.3 }}
          >
            {/* Dashboard Section */}
            {activeSection === 'dashboard' && (
              <div className="space-y-6">
                <div className="text-center">
                  <h2 className="text-3xl font-bold text-white mb-4">
                    AI-Powered Performance Testing
                  </h2>
                  <p className="text-gray-300 max-w-2xl mx-auto">
                    Configure and execute comprehensive performance tests with real-time monitoring 
                    and intelligent AI analysis. Get instant insights and recommendations.
                  </p>
                </div>
                
                <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
                  <div className="card cursor-pointer" onClick={() => setActiveSection('config')}>
                    <div className="flex items-center space-x-3">
                      <Settings className="h-8 w-8 text-blue-400" />
                      <div>
                        <h3 className="text-lg font-semibold text-white">Test Configuration</h3>
                        <p className="text-gray-400">Set up your performance tests</p>
                      </div>
                    </div>
                  </div>
                  
                  <div className="card cursor-pointer" onClick={() => setActiveSection('monitoring')}>
                    <div className="flex items-center space-x-3">
                      <BarChart3 className="h-8 w-8 text-green-400" />
                      <div>
                        <h3 className="text-lg font-semibold text-white">Real-time Monitoring</h3>
                        <p className="text-gray-400">Watch tests in progress</p>
                      </div>
                    </div>
                  </div>
                  
                  <div className="card cursor-pointer" onClick={() => setActiveSection('analysis')}>
                    <div className="flex items-center space-x-3">
                      <Brain className="h-8 w-8 text-purple-400" />
                      <div>
                        <h3 className="text-lg font-semibold text-white">AI Analysis</h3>
                        <p className="text-gray-400">Get intelligent insights</p>
                      </div>
                    </div>
                  </div>
                </div>

                {/* Quick Stats */}
                <div className="grid grid-cols-1 md:grid-cols-4 gap-6">
                  <div className="card">
                    <div className="text-center">
                      <div className="text-2xl font-bold text-blue-400">{testHistory.length}</div>
                      <div className="text-sm text-gray-400">Total Tests</div>
                    </div>
                  </div>
                  <div className="card">
                    <div className="text-center">
                      <div className="text-2xl font-bold text-green-400">
                        {testHistory.filter(t => t.status === 'completed').length}
                      </div>
                      <div className="text-sm text-gray-400">Completed</div>
                    </div>
                  </div>
                  <div className="card">
                    <div className="text-center">
                      <div className="text-2xl font-bold text-yellow-400">
                        {testHistory.filter(t => t.status === 'running').length}
                      </div>
                      <div className="text-sm text-gray-400">Running</div>
                    </div>
                  </div>
                  <div className="card">
                    <div className="text-center">
                      <div className="text-2xl font-bold text-purple-400">
                        {connectionStatus === 'connected' ? 'Active' : 'Inactive'}
                      </div>
                      <div className="text-sm text-gray-400">Backend Status</div>
                    </div>
                  </div>
                </div>
              </div>
            )}

            {/* Test Configuration Section */}
            {activeSection === 'config' && (
              <div className="space-y-6">
                <div className="card">
                  <div className="flex items-center space-x-3">
                    <Settings className="h-6 w-6 text-blue-400" />
                    <div>
                      <h2 className="text-xl font-semibold text-white">JMeter Test Configuration</h2>
                      <p className="text-gray-400">Configure your performance test parameters</p>
                    </div>
                  </div>
                </div>

                {/* Test Type Selection */}
                <div className="card">
                  <h3 className="text-lg font-semibold text-white mb-4">Test Type</h3>
                  <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
                    {['Load Test', 'Stress Test', 'Spike Test', 'Soak Test'].map((type) => (
                      <div
                        key={type}
                        className={`p-4 rounded-lg border-2 cursor-pointer transition-colors ${
                          testConfig.type === type
                            ? 'border-blue-400 bg-blue-900/20'
                            : 'border-gray-600 bg-gray-800/20 hover:border-gray-500'
                        }`}
                        onClick={() => setTestConfig(prev => ({ ...prev, type }))}
                      >
                        <div className="flex items-center space-x-3">
                          <Target className="h-5 w-5 text-blue-400" />
                          <div>
                            <h4 className="font-semibold text-white">{type}</h4>
                            <p className="text-sm text-gray-400">
                              {type === 'Load Test' && 'Normal load testing with steady user count'}
                              {type === 'Stress Test' && 'High load testing to find breaking point'}
                              {type === 'Spike Test' && 'Sudden load spikes to test system resilience'}
                              {type === 'Soak Test' && 'Extended duration testing for stability'}
                            </p>
                          </div>
                        </div>
                      </div>
                    ))}
                  </div>
                </div>

                {/* Test Parameters */}
                <div className="card">
                  <h3 className="text-lg font-semibold text-white mb-4">Test Parameters</h3>
                  <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
                    <div>
                      <label className="block text-sm font-medium text-gray-300 mb-2">
                        Target URL
                      </label>
                      <input
                        type="url"
                        value={testConfig.url}
                        onChange={(e) => setTestConfig(prev => ({ ...prev, url: e.target.value }))}
                        placeholder="https://example.com"
                        className="input-field w-full"
                      />
                    </div>

                    <div>
                      <label className="block text-sm font-medium text-gray-300 mb-2">
                        Number of Users
                      </label>
                      <div className="relative">
                        <Users className="absolute left-3 top-1/2 transform -translate-y-1/2 h-4 w-4 text-gray-400" />
                        <input
                          type="number"
                          value={testConfig.users}
                          onChange={(e) => setTestConfig(prev => ({ ...prev, users: parseInt(e.target.value) || 0 }))}
                          min="1"
                          max="1000"
                          className="input-field w-full pl-10"
                        />
                      </div>
                    </div>

                    <div>
                      <label className="block text-sm font-medium text-gray-300 mb-2">
                        Test Duration (seconds)
                      </label>
                      <div className="relative">
                        <Clock className="absolute left-3 top-1/2 transform -translate-y-1/2 h-4 w-4 text-gray-400" />
                        <input
                          type="number"
                          value={testConfig.duration}
                          onChange={(e) => setTestConfig(prev => ({ ...prev, duration: parseInt(e.target.value) || 0 }))}
                          min="60"
                          max="3600"
                          className="input-field w-full pl-10"
                        />
                      </div>
                    </div>

                    <div>
                      <label className="block text-sm font-medium text-gray-300 mb-2">
                        Ramp-up Time (seconds)
                      </label>
                      <input
                        type="number"
                        value={testConfig.rampUp}
                        onChange={(e) => setTestConfig(prev => ({ ...prev, rampUp: parseInt(e.target.value) || 0 }))}
                        min="1"
                        max="300"
                        className="input-field w-full"
                      />
                    </div>
                  </div>
                </div>

                {/* Test Summary */}
                <div className="card">
                  <h3 className="text-lg font-semibold text-white mb-4">Test Summary</h3>
                  <div className="grid grid-cols-2 md:grid-cols-4 gap-4">
                    <div className="text-center">
                      <div className="text-2xl font-bold text-blue-400">{testConfig.type}</div>
                      <div className="text-sm text-gray-400">Test Type</div>
                    </div>
                    <div className="text-center">
                      <div className="text-2xl font-bold text-green-400">{testConfig.users}</div>
                      <div className="text-sm text-gray-400">Users</div>
                    </div>
                    <div className="text-center">
                      <div className="text-2xl font-bold text-yellow-400">{formatDuration(testConfig.duration)}</div>
                      <div className="text-sm text-gray-400">Duration</div>
                    </div>
                    <div className="text-center">
                      <div className="text-2xl font-bold text-purple-400">{testConfig.rampUp}s</div>
                      <div className="text-sm text-gray-400">Ramp-up</div>
                    </div>
                  </div>
                </div>

                {/* Action Buttons */}
                <div className="flex justify-center space-x-4">
                  <motion.button
                    whileHover={{ scale: 1.05 }}
                    whileTap={{ scale: 0.95 }}
                    onClick={handleStartTest}
                    disabled={loading || !testConfig.url.trim()}
                    className="btn-primary text-lg px-8 py-4 disabled:opacity-50 disabled:cursor-not-allowed"
                  >
                    {loading ? (
                      <div className="flex items-center space-x-2">
                        <div className="animate-spin rounded-full h-5 w-5 border-b-2 border-white"></div>
                        <span>Starting Test...</span>
                      </div>
                    ) : (
                      <div className="flex items-center space-x-2">
                        <Play className="h-5 w-5" />
                        <span>Start JMeter Test</span>
                      </div>
                    )}
                  </motion.button>
                </div>
              </div>
            )}

            {/* Monitoring Section */}
            {activeSection === 'monitoring' && (
              <div className="space-y-6">
                <div className="card">
                  <div className="flex items-center justify-between">
                    <div className="flex items-center space-x-3">
                      <BarChart3 className="h-6 w-6 text-green-400" />
                      <div>
                        <h2 className="text-xl font-semibold text-white">Real-time Monitoring</h2>
                        <p className="text-gray-400">Live test progress and metrics</p>
                      </div>
                    </div>
                    {currentTest && (
                      <div className="flex space-x-2">
                        <button
                          onClick={handleStopTest}
                          className="btn-secondary"
                        >
                          <Square className="h-4 w-4 mr-2" />
                          Stop Test
                        </button>
                      </div>
                    )}
                  </div>
                </div>

                {currentTest ? (
                  <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6">
                    <div className="card">
                      <div className="text-center">
                        <div className="text-3xl font-bold text-blue-400">{testConfig.users}</div>
                        <div className="text-sm text-gray-400">Active Users</div>
                      </div>
                    </div>
                    <div className="card">
                      <div className="text-center">
                        <div className="text-3xl font-bold text-green-400">--</div>
                        <div className="text-sm text-gray-400">Avg Response Time</div>
                      </div>
                    </div>
                    <div className="card">
                      <div className="text-center">
                        <div className="text-3xl font-bold text-yellow-400">--</div>
                        <div className="text-sm text-gray-400">Success Rate</div>
                      </div>
                    </div>
                    <div className="card">
                      <div className="text-center">
                        <div className="text-3xl font-bold text-purple-400">--</div>
                        <div className="text-sm text-gray-400">Requests/sec</div>
                      </div>
                    </div>
                  </div>
                ) : (
                  <div className="card">
                    <div className="text-center py-12">
                      <BarChart3 className="h-12 w-12 text-gray-400 mx-auto mb-4" />
                      <h3 className="text-lg font-medium text-white mb-2">No Active Test</h3>
                      <p className="text-gray-400">
                        Start a test from the configuration section to see real-time monitoring
                      </p>
                    </div>
                  </div>
                )}
              </div>
            )}

            {/* Results Section */}
            {activeSection === 'results' && (
              <div className="space-y-6">
                <div className="card">
                  <div className="flex items-center justify-between">
                    <div className="flex items-center space-x-3">
                      <Zap className="h-6 w-6 text-yellow-400" />
                      <div>
                        <h2 className="text-xl font-semibold text-white">Test Results</h2>
                        <p className="text-gray-400">Performance test results and metrics</p>
                      </div>
                    </div>
                    <button
                      onClick={() => handleAnalyze(testResults)}
                      className="btn-primary"
                    >
                      <Brain className="h-4 w-4 mr-2" />
                      Analyze with AI
                    </button>
                  </div>
                </div>

                {testResults ? (
                  <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6">
                    <div className="card">
                      <div className="text-center">
                        <div className="text-3xl font-bold text-blue-400">
                          {testResults.totalRequests || 0}
                        </div>
                        <div className="text-sm text-gray-400">Total Requests</div>
                      </div>
                    </div>
                    <div className="card">
                      <div className="text-center">
                        <div className="text-3xl font-bold text-green-400">
                          {testResults.successfulRequests || 0}
                        </div>
                        <div className="text-sm text-gray-400">Successful Requests</div>
                      </div>
                    </div>
                    <div className="card">
                      <div className="text-center">
                        <div className="text-3xl font-bold text-yellow-400">
                          {testResults.avgResponseTime || 0}ms
                        </div>
                        <div className="text-sm text-gray-400">Avg Response Time</div>
                      </div>
                    </div>
                    <div className="card">
                      <div className="text-center">
                        <div className="text-3xl font-bold text-purple-400">
                          {testResults.peakRPS || 0}
                        </div>
                        <div className="text-sm text-gray-400">Peak RPS</div>
                      </div>
                    </div>
                  </div>
                ) : (
                  <div className="card">
                    <div className="text-center py-12">
                      <Zap className="h-12 w-12 text-gray-400 mx-auto mb-4" />
                      <h3 className="text-lg font-medium text-white mb-2">No Results Available</h3>
                      <p className="text-gray-400">
                        Complete a test to see results here
                      </p>
                    </div>
                  </div>
                )}
              </div>
            )}

            {/* AI Analysis Section */}
            {activeSection === 'analysis' && (
              <div className="space-y-6">
                <div className="card">
                  <div className="flex items-center justify-between">
                    <div className="flex items-center space-x-3">
                      <Brain className="h-6 w-6 text-purple-400" />
                      <div>
                        <h2 className="text-xl font-semibold text-white">AI Analysis</h2>
                        <p className="text-gray-400">Intelligent performance insights and recommendations</p>
                      </div>
                    </div>
                    <button
                      onClick={() => setShowImageInput(!showImageInput)}
                      className="btn-secondary"
                    >
                      <Upload className="h-4 w-4 mr-2" />
                      {showImageInput ? 'Hide Image' : 'Add Image'}
                    </button>
                  </div>
                </div>

                {showImageInput && (
                  <div className="card">
                    <h3 className="text-lg font-semibold text-white mb-4">Image Analysis</h3>
                    <div className="space-y-4">
                      <div>
                        <label className="block text-sm font-medium text-gray-300 mb-2">
                          Image URL
                        </label>
                        <input
                          type="url"
                          value={imageUrl}
                          onChange={(e) => setImageUrl(e.target.value)}
                          placeholder="https://example.com/image.jpg"
                          className="input-field w-full"
                        />
                      </div>
                      <p className="text-sm text-gray-400">
                        Add screenshots or charts to get enhanced AI analysis with visual context.
                      </p>
                    </div>
                  </div>
                )}

                {analysis ? (
                  <div className="space-y-6">
                    {/* Analysis Summary */}
                    <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
                      <div className="card">
                        <div className="text-center">
                          <div className="text-2xl font-bold text-green-400">
                            {analysis.analysis?.assessment || 'N/A'}
                          </div>
                          <div className="text-sm text-gray-400">Assessment</div>
                        </div>
                      </div>
                      <div className="card">
                        <div className="text-center">
                          <div className="text-2xl font-bold text-yellow-400">
                            {analysis.agent_response?.severity || 'MEDIUM'}
                          </div>
                          <div className="text-sm text-gray-400">Severity</div>
                        </div>
                      </div>
                      <div className="card">
                        <div className="text-center">
                          <div className="text-2xl font-bold text-purple-400">
                            {Math.round((analysis.analysis?.confidence_score || 0) * 100)}%
                          </div>
                          <div className="text-sm text-gray-400">Confidence</div>
                        </div>
                      </div>
                    </div>

                    {/* AI Insights */}
                    <div className="card">
                      <h3 className="text-lg font-semibold text-white mb-4">AI Insights</h3>
                      <div className="space-y-3">
                        {analysis.analysis?.insights?.map((insight, index) => (
                          <div key={index} className="flex items-start space-x-3">
                            <div className="w-2 h-2 bg-purple-400 rounded-full mt-2 flex-shrink-0"></div>
                            <p className="text-gray-300">{insight}</p>
                          </div>
                        ))}
                      </div>
                    </div>

                    {/* Recommendations */}
                    <div className="card">
                      <h3 className="text-lg font-semibold text-white mb-4">AI Recommendations</h3>
                      <div className="space-y-3">
                        {analysis.analysis?.recommendations?.map((recommendation, index) => (
                          <div key={index} className="flex items-start space-x-3">
                            <div className="w-2 h-2 bg-blue-400 rounded-full mt-2 flex-shrink-0"></div>
                            <p className="text-gray-300">{recommendation}</p>
                          </div>
                        ))}
                      </div>
                    </div>
                  </div>
                ) : (
                  <div className="card">
                    <div className="text-center py-12">
                      <Brain className="h-12 w-12 text-gray-400 mx-auto mb-4" />
                      <h3 className="text-lg font-medium text-white mb-2">No Analysis Available</h3>
                      <p className="text-gray-400">
                        Run a test and analyze results to see AI insights here
                      </p>
                    </div>
                  </div>
                )}
              </div>
            )}

            {/* History Section */}
            {activeSection === 'history' && (
              <div className="space-y-6">
                <div className="card">
                  <div className="flex items-center justify-between">
                    <div className="flex items-center space-x-3">
                      <History className="h-6 w-6 text-orange-400" />
                      <div>
                        <h2 className="text-xl font-semibold text-white">Test History</h2>
                        <p className="text-gray-400">Previous test results and performance data</p>
                      </div>
                    </div>
                    <button
                      onClick={loadTestHistory}
                      className="btn-secondary"
                    >
                      <RotateCcw className="h-4 w-4 mr-2" />
                      Refresh
                    </button>
                  </div>
                </div>

                {testHistory.length > 0 ? (
                  <div className="space-y-4">
                    {testHistory.map((test, index) => (
                      <div key={index} className="card">
                        <div className="flex items-center justify-between">
                          <div className="flex items-center space-x-4">
                            <div className="flex items-center space-x-2">
                              <Target className="h-5 w-5 text-blue-400" />
                              <span className="font-semibold text-white">{test.type}</span>
                            </div>
                            <div className="text-sm text-gray-400">
                              {test.users} users  {formatDuration(test.duration)}
                            </div>
                          </div>
                          <div className="flex items-center space-x-4">
                            <div className="text-right">
                              <div className="text-sm font-medium text-white">
                                {test.success_rate?.toFixed(1) || 0}% Success
                              </div>
                              <div className="text-xs text-gray-400">
                                {test.avg_response_time || 0}ms avg
                              </div>
                            </div>
                            <div className={`px-2 py-1 rounded text-xs ${
                              test.status === 'completed' ? 'bg-green-900/20 text-green-400' :
                              test.status === 'running' ? 'bg-yellow-900/20 text-yellow-400' :
                              'bg-gray-900/20 text-gray-400'
                            }`}>
                              {test.status}
                            </div>
                          </div>
                        </div>
                      </div>
                    ))}
                  </div>
                ) : (
                  <div className="card">
                    <div className="text-center py-12">
                      <History className="h-12 w-12 text-gray-400 mx-auto mb-4" />
                      <h3 className="text-lg font-medium text-white mb-2">No Test History</h3>
                      <p className="text-gray-400">
                        Run your first test to see history here
                      </p>
                    </div>
                  </div>
                )}
              </div>
            )}
          </motion.div>
        </AnimatePresence>
      </main>
    </div>
  );
}

export default App;
